import React from 'react';
import './App.css';

function App() {

    function addTrack(message: any) {
        console.log(message)
    }
  return (
    <div className="App">
     <div>
         <input type='text'
                onChange={ (event) => { addTrack(event.currentTarget.value) } }></input>
         <button onClick={ addTrack }>Добавить</button>
     </div>
    </div>
  );
}

export default App;
